import { MapForm } from "../components/Forms/CRUD/MapForm";
import api from "../services/api";
import { Map } from "../types";

async function onSubmit(map: Map) {
    try{
        await api.post('/api/Data/mapas', {
            map_id: map.map_id,
            map_desc: map.map_desc,
            map_atr: map.map_atr,
            map_value: map.map_value,
            map_subctg_id: map.map_subctg_id,
            choropleth: map.choropleth,
        });
    } catch (err) {
        console.log(err);
    }
}

function onCancel() {
    console.log("Cancel");
}

export const Upload: React.FC = () => {


    return (
        <MapForm {...{onSubmit, onCancel}}/>
    );
}
